package Loop_If_Else_Demo;

public class Arithmetic_operator {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=5;
		int b=10;
		int c = a + b;
		System.out.println(c);
		
		c = a - b;
		System.out.println(c);
		
		c = a * b;
		System.out.println(c);
		
		c = b / a;
		System.out.println(c);
	}

}
